import React from 'react'
import { Home,Github } from 'lucide-react';
function Sidebar() {
  return (
    <div className= 'bg-[#1c1b23] sidebar overflow-scroll md:m-[1rem] m-[0.2rem] h-[95vh] md:w-[20vw] '>
      <div className='m-[2rem]'>
         <p className='flex text-[#818086]' ><Home color="#818086"/>Home</p>
         <p className='flex text-[#818086]' ><Home color="#818086" />Videos</p>
         <p className='text-[#818086]'>Socials</p>
         <p className='flex text-[#818086]' ><Github color="cyan" />Github</p>
      </div>
    </div>
  )
}

export default Sidebar
